function PrintBarcode() {
    kendo.drawing.drawDOM($("#multiplebarcodes"), {
        landscape: false,
        scale: 0.5,
        paperSize: "LEGAL",
        margin: {
            left: "3mm",
            top: "10mm",
            right: "3mm",
            bottom: "10mm"
        },
    }).then(function (group) {
        kendo.drawing.pdf.toDataURL(group, function (dataURL) {
            var pdfurl = dataURL.split('data:application/pdf;base64,').join('');

            PDFViewer(pdfurl, true, null, null, true);

            $("#multiplebarcodes").html('');
        });
    });
}

function UserBrowser() {
    //Check if browser is IE or not
    if (isIE()) {
        return "IE"
    }
        //Check if browser is Chrome or not
    else if (navigator.userAgent.search("Chrome") >= 0) {
        return "Chrome"
    }
        //Check if browser is Firefox or not
    else if (navigator.userAgent.search("Firefox") >= 0) {
        return "Firefox";
    }
        //Check if browser is Safari or not
    else if (navigator.userAgent.search("Safari") >= 0 && navigator.userAgent.search("Chrome") < 0) {
        return "Safari"
    }
        //Check if browser is Opera or not
    else if (navigator.userAgent.search("Opera") >= 0) {
        return "Opera";
    }

    function isIE(userAgent) {
        userAgent = userAgent || navigator.userAgent;
        return userAgent.indexOf("MSIE ") > -1 || userAgent.indexOf("Trident/") > -1;
    }
}

function readypdfRendered(win) {
    return new Promise(function (resolve) {
        function checkReady(event) {
            if (win.document.readyState === 'complete') {
                resolve(win);
            }
        }

        try {
            win.focus();
            win.addEventListener('pagesloaded', checkReady, false);
        }
        catch (ex) {
            console.log(ex);
        }
    });
}

function PDFViewer(base64, IsnewTab, ObjectControlID, IsIframe, IsPrint) {
    if (IsnewTab) {
        var byteCharacters = atob(base64);
        var byteNumbers = new Array(byteCharacters.length);

        for (var i = 0; i < byteCharacters.length; i++) {
            byteNumbers[i] = byteCharacters.charCodeAt(i);
        }

        var byteArray = new Uint8Array(byteNumbers);
        var blob = new Blob([byteArray], { type: "application/pdf;base64" });
        var url = URL.createObjectURL(blob);
        var viewerUrl = 'Scripts/pdf/web/viewer.html?file=' + encodeURIComponent(url);

        if (IsPrint == null || !IsPrint) {
            window.open(viewerUrl, "popup", "menubar=1,resizable=1,width=500,height=500");
        }
        else {
            readypdfRendered(open(viewerUrl, "popup", "menubar=1,resizable=1,width=500,height=500")).then(function (win) {
                //pdf is ready
                win.focus();
                win.print();
            });
        }

    }
    else {
        if (UserBrowser() == "Firefox") {
            var byteCharacters = atob(base64);
            var byteNumbers = new Array(byteCharacters.length);

            for (var i = 0; i < byteCharacters.length; i++) {
                byteNumbers[i] = byteCharacters.charCodeAt(i);
            }

            var byteArray = new Uint8Array(byteNumbers);
            var blob = new Blob([byteArray], { type: "application/pdf" });
            var blobUrl = URL.createObjectURL(blob);

            if (IsIframe) {
                $('#' + ObjectControlID).attr('src', blobUrl);
            }
            else {
                $('#' + ObjectControlID).attr('data', blobUrl);
            }
        }
        else {
            $('#' + ObjectControlID).parent().find("#helperPDF").val(base64);

            if (IsIframe) {
                $('#' + ObjectControlID).attr('src', 'Scripts/pdf/web/viewer.html');
            }
            else {
                $('#' + ObjectControlID).attr('data', 'Scripts/pdf/web/viewer.html');
            }
        }
    }

    function base64ToUint8Array(base64) {
        var raw = atob(base64);
        var uint8Array = new Uint8Array(raw.length);

        for (var i = 0; i < raw.length; i++) {
            uint8Array[i] = raw.charCodeAt(i);
        }

        return uint8Array;
    }

    function bindEvent(el, eventName, eventHandler) {
        if (el.addEventListener) {
            el.addEventListener(eventName, eventHandler, false);
        }
        else if (el.attachEvent) {
            el.attachEvent('on' + eventName, eventHandler);
        }
    }
}